INSERT INTO `field_data_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'page', 0, 2, 2, 'und', 0, '<p>404 page not found</p>\r\n', '', 'filtered_html'),
('node', 'page', 0, 3, 3, 'und', 0, '<p>An ever-growing, ever-evolving internet drives us to adapt, to produce websites and website applications that are functional, scalable, and optimized with the<br />\r\nlatest technologies. We can develop a framework that is simple or complex, customized to suit your needs and business goals. Let us help, or even do it for you.</p>\r\n\r\n<p>Our developers have a diverse set of skills to handle your project. Take a look at our extensive repertoire:</p>\r\n\r\n<table border="0" cellpadding="1" cellspacing="1">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<h2>Scripting Languages:</h2>\r\n\r\n			<p>• &nbsp; Java Scripts<br />\r\n			• &nbsp; PHP</p>\r\n			</td>\r\n			<td>\r\n			<h2>Microsoft Technologies:</h2>\r\n\r\n			<p>• &nbsp; ASP<br />\r\n			• &nbsp; ASP.NET<br />\r\n			• &nbsp; C#<br />\r\n			• &nbsp; MSSQL<br />\r\n			• &nbsp; .NET Framework<br />\r\n			• &nbsp; Visual Studio</p>\r\n			</td>\r\n			<td>\r\n			<h2>Programming Languages &amp; Applications:</h2>\r\n\r\n			<p>• &nbsp; Ajax<br />\r\n			• &nbsp; Java<br />\r\n			• &nbsp; Flash<br />\r\n			• &nbsp; MySQL<br />\r\n			• &nbsp; SQL<br />\r\n			• &nbsp; Zend Framework</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', '', 'filtered_html'),
('node', 'about_us_team', 0, 4, 4, 'und', 0, '<p>Smartexe is a leading offshore services partner, providing our clients with the resources they need to solve product- or process-related issues. We specialize in software design,<br />\r\ndevelopment, integration, project management and product management. &nbsp;Our technology specialists are located throughout a worldwide network of R&amp;D centers, ready to take<br />\r\non any challenge.</p>\r\n\r\n<p>Since 2004, we’ve worked with a variety of companies requiring high-tech, innovative solutions. We’ve helped companies of all sizes, from small start-ups to well-established enterprises.<br />\r\nThe verticals we serve are also diverse, and our expertise has grown over time to include scalable web technologies, mobile applications, product design, cloud technologies, and quality assurance.</p>\r\n\r\n<p>To put it concisely: we’ll pair your ideas with our technical expertise to help you and your company succeed. Whether we’re designing a product from the ground up or managing<br />\r\na project segment, our goal is to see both your ideas and your profits spring to life.</p>\r\n', '', 'filtered_html');
