INSERT INTO `field_data_field_team_description` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `field_team_description_value`, `field_team_description_format`) VALUES
('field_collection_item', 'field_team_member', 0, 9, 9, 'und', 0, '<p>Dr. Panich is the driving force behind Smart.exe. He has more than 30 years’ experience in the fields of academia, technology, and Research and Development. His previous positions include:</p>\r\n\r\n<p>•&nbsp;&nbsp; &nbsp;CTO and VP of R&amp;D at VBox Communications<br />\r\n•&nbsp;&nbsp; &nbsp;Hardware Development Manager at Optibase Ltd.<br />\r\n•&nbsp;&nbsp; &nbsp;Management at Orbit Communication Systems Ltd. and Scitex Technologies Ltd.&nbsp;</p>\r\n', 'filtered_html'),
('field_collection_item', 'field_team_member', 0, 10, 10, 'und', 0, '<p>Ms. Volokh brings over 20 years of QA experience to the Smart.exe team. Her<br />\r\nexpertise ranges from procedures including test automation implementation to load and performance testing. Her skills include project and team management. She often builds and leads QA and technical support teams. Throughout her career, Ms Volokh has worked in diverse fields such as telephone and voicemail systems, personalized advertising, search and merchandising for e-commerce ventures, and content<br />\r\nintegration networks. Her previous positions include:</p>\r\n\r\n<p>•&nbsp;&nbsp; &nbsp;QA Manager at WebCollage Inc.<br />\r\n•&nbsp;&nbsp; &nbsp;Director of Technical Operations at Mercado Software Inc.<br />\r\n•&nbsp;&nbsp; &nbsp;QA Manager at Manna Inc.&nbsp;</p>\r\n\r\n<p>Mrs. Volokh holds an MSc degree in Applied Mathematics from Vilnius University.</p>\r\n', 'filtered_html'),
('field_collection_item', 'field_team_member', 0, 11, 11, 'und', 0, '<p>Mr. Liberman brings a unique set of product and project management skills to the Smart.exe team obtained throughout his 10 years in the field. He’s worked hands-on in mobile technology, telecommunications, Web, and cloud systems. His previous positions include:</p>\r\n\r\n<p>•&nbsp;&nbsp; &nbsp;VP Product Planning and Director of Product Management at ELSE Ltd.<br />\r\n•&nbsp;&nbsp; &nbsp;Products Planning and Marketing Department Manager at Pelephone<br />\r\n&nbsp;&nbsp; &nbsp;Communication Ltd.&nbsp;</p>\r\n\r\n<p>Mr. Liberman is also the owner of PronNovo, a company that offers consulting and product-management services to enterprises in the fields of telecommunications and Web. Mr. Liberman holds a BA in Business Administration from Open<br />\r\nUniversity in Israel.</p>\r\n', 'filtered_html');
INSERT INTO `field_data_field_team_featured_description` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `field_team_featured_description_value`, `field_team_featured_description_format`) VALUES
('field_collection_item', 'field_team_member', 0, 9, 9, 'und', 0, '<p>His primary areas of expertise are video compression/decompression techniques and video-over-IP streaming. Over the years, he’s acquired a vast range of skills in a variety of areas, including computer vision and object recognition, graphic<br />\r\nprocessing, and DSP and PC systems. Dr. Panich holds an MSc degree in Electronics from the Polytechnic University of Vinnitsa as well as a Masters in Computer Sytems Development and a PhD in Computers and Automation Systems, both from the Polytechnic University of Kharkov.</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'filtered_html');
INSERT INTO `field_data_field_team_introduction` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `field_team_introduction_value`, `field_team_introduction_format`) VALUES
('node', 'about_us_team', 0, 4, 4, 'und', 0, '<p>Our team is made up of professionals who possess impeccable credentials in their respective fields. Smart.exe is more than a group of experts; we are focused on helping companies<br />\r\nbring their innovative ideas to the market – our staff is our greatest asset.</p>\r\n', 'filtered_html');
