INSERT INTO `search_dataset` (`sid`, `type`, `data`, `reindex`) VALUES
(1, 'node', ' our clients our clients are our best ambassadors we re proud to have a growing family of recurring customers who appreciate our professional and costsensitive approach speedy reaction and flexible inventive thinking their success is the most rewarding and apparent proof of our efficiency we d be honored to add you to our growing list of clients you d be amongst great company have a look logo client name actus link http wwwactuscom open in new window logo client name appetude link http wwwappetudecom open in new window logo client name araneo link http wwwaraneocom open in new window logo client name choozon link http wwwchoozoncom open in same window logo client name click n goal link http wwwclickngoalcom open in same window logo client name cloudkafe link http wwwcloudkafecom open in new window logo client name bobvious link http wwwbobviouscom open in new window logo client name things2do link http wwwthings2docom open in same window  ', 0),
(2, 'node', ' 404 404 page not found  ', 0),
(3, 'node', ' web development an evergrowing everevolving internet drives us to adapt to produce websites and website applications that are functional scalable and optimized with the latest technologies we can develop a framework that is simple or complex customized to suit your needs and business goals let us help or even do it for you our developers have a diverse set of skills to handle your project take a look at our extensive repertoire scripting languages java scripts php microsoft technologies asp aspnet c mssql net framework visual studio programming languages applications ajax java flash mysql sql zend framework  ', 0),
(4, 'node', ' about us smartexe is a leading offshore services partner providing our clients with the resources they need to solve product or processrelated issues we specialize in software design development integration project management and product management our technology specialists are located throughout a worldwide network of r d centers ready to take on any challenge since 2004 we ve worked with a variety of companies requiring hightech innovative solutions we ve helped companies of all sizes from small startups to wellestablished enterprises the verticals we serve are also diverse and our expertise has grown over time to include scalable web technologies mobile applications product design cloud technologies and quality assurance to put it concisely we ll pair your ideas with our technical expertise to help you and your company succeed whether we re designing a product from the ground up or managing a project segment our goal is to see both your ideas and your profits spring to life full name dr nachum panich position founder and ceo description dr panich is the driving force behind smartexe he has more than 30 years experience in the fields of academia technology and research and development his previous positions include cto and vp of r d at vbox communications hardware development manager at optibase ltd management at orbit communication systems ltd and scitex technologies ltd featured description his primary areas of expertise are video compression decompression techniques and videooverip streaming over the years he s acquired a vast range of skills in a variety of areas including computer vision and object recognition graphic processing and dsp and pc systems dr panich holds an msc degree in electronics from the polytechnic university of vinnitsa as well as a masters in computer sytems development and a phd in computers and automation systems both from the polytechnic university of kharkov full name ilana volokh position vp of quality assurance description ms volokh brings over 20 years of qa experience to the smartexe team her expertise ranges from procedures including test automation implementation to load and performance testing her skills include project and team management she often builds and leads qa and technical support teams throughout her career ms volokh has worked in diverse fields such as telephone and voicemail systems personalized advertising search and merchandising for ecommerce ventures and content integration networks her previous positions include qa manager at webcollage inc director of technical operations at mercado software inc qa manager at manna inc mrs volokh holds an msc degree in applied mathematics from vilnius university full name roni liberman position vp of products description mr liberman brings a unique set of product and project management skills to the smartexe team obtained throughout his 10 years in the field he s worked handson in mobile technology telecommunications web and cloud systems his previous positions include vp product planning and director of product management at else ltd products planning and marketing department manager at pelephone communication ltd mr liberman is also the owner of pronnovo a company that offers consulting and productmanagement services to enterprises in the fields of telecommunications and web mr liberman holds a ba in business administration from open university in israel team our team is made up of professionals who possess impeccable credentials in their respective fields smartexe is more than a group of experts we are focused on helping companies bring their innovative ideas to the market our staff is our greatest asset  ', 0);
